import React, { Component } from 'react'
import { Input,Button,List, Typography, Divider} from 'antd';
import 'antd/dist/antd.css'

export default class Person extends Component {
    addPerson = () => {
        const name = this.nameNode.setValue;
        
    }
    render() {  
        return (
            <div>
                &nbsp;<Input type='text' style={{ width: 120 }} placeholder="输入名字" ref={ c=>this.nameNode = c} /><br/><br/>
                &nbsp;<Input type='password' style={{ width: 120 }} placeholder="输入年龄" ref = {c => this.ageNode = c}  /><br/><br/>
                &nbsp;<Button type="primary" onClick ={this.addPerson} >添加</Button>
                <ul>
                    <li>名字1--年龄1</li>
                    <li>名字2--年龄2</li>
                    <li>名字3--年龄3</li>
                </ul>
            </div>
        )
    }
}
